import React, { Component } from 'react';
import './App.css';
import Home from './Components/Home';
import _LayoutSIP from './Components/Layout/_LayoutSIP';
import _LayoutAbout from './Components/Layout/_LayoutAbout';
import _LayoutIndex from './Components/Layout/_LayoutIndex';
import _LayoutPagepolicy from './Components/Layout/_LayoutPagepolicy';


class App extends Component {
    render() {
        return (
            <div className="App">
                <Home />
                <_LayoutSIP />
                <_LayoutAbout />
                <_LayoutIndex />
                <_LayoutPagepolicy />

            </div>

        );
    }
}

export default App;
